import { NavLink } from "react-router-dom";
import Layout from "../components/layout/layout";

function Dashboard() {
  const position = { topbar: "flex gap-5" };
  const design = { topbar: "font-medium", active: "text-gray-200" };

  return (
    <Layout>
      <div className={`${position.topbar} ${design.topbar}`}>
        <NavLink exact to="/dashboard#profile" activeStyles={design.active}>
          Profile
        </NavLink>
        <NavLink exact to="/dashboard#inbox" activeStyles={design.active}>
          Inbox
        </NavLink>
        <NavLink exact to="/dashboard#orders" activeStyles={design.active}>
          Orders
        </NavLink>
        <NavLink exact to="/dashboard#favorites" activeStyles={design.active}>
          Favourites
        </NavLink>
        <NavLink exact to="/dashboard#settings" activeStyles={design.active}>
          Settings
        </NavLink>
      </div>
    </Layout>
  );
}

export default Dashboard;
